2531e63d-dd5d-49df-93a2-5754408e18e6	2020-11-08 06:43:43.630141+00	2020-11-20 12:52:02.287677+00	{"ar": "مدينة نصر للاسكان و التعمير ", "en": "MNHD"}	\N	mnhd	مدينة-نصر-للاسكان-و-التعمير	{"ar": "شركة مدينة نصر للإسكان والتعمير الرائدة في مجال التطوير العقاري في مصر تأسست عام 1959 كشركة عامة، وتم طرحها للتداول في البورصة المصرية عام 1995.\\n\\nوقد تم إطلاق شركة مدينة نصر للإسكان والتعمير في البداية لتطوير 40 مليون متر مربع من الأراضي في مدينة نصر والمناطق المجاورة في محافظة القاهرة.\\n\\nومنذ هذا الوقت ومن خلال فريق مؤهل يتجاوز 450 من المحترفين طورت شركة مدينة نصر للاسكان والتعمير مجموعة من المشاريع الضخمة بالإضافة لمشروعات البنية التحتة في ربوع مصر لبت من خلالها احتياجات الاف المصريين في شريحة الدخل المتوسط.\\n\\nومع عملية إعادة الهيكلة الشاملة للشركة، وسعت مدينة نصر للاسكان و التعمير من الفئات المستهدفة لديها لتضم الطبقة العليا.\\n\\nوللاستفادة من الفرص المتاحة بهذة الفئة التي تمثل قوة كامنة بسوق العقارات، أطلقت شركة مدينة نصر للإسكان مشروعا ت “تاج سيتى” و “سراى” السكنية الضخمة متعددة الإستخدمات.\\n\\nومن أجل تحقيق هذه الأهداف، تعاقدت شركة مدينة  نصر للإسكان مع أشهر شركات الهندسة والتصميمات المعمارية العالمية لتطوير خطة الشركة الرئيسية لتتماشى مع رؤيتها لإنشاء مشروعات تمثل وجهات لكل عملائها أكثر من مجرد مشروع سكني.\\n\\nومتواكبة مع أفضل المعايير الدولية، أطلقت شركة مدينة نصر مشروعين في القاهرة هما “تاج سيتي” ليكون وجهة ثقافية و “سراي” ليكون وجهة ترفيهية مميزة، والذين تم تصميم مخططهم العام عبر أشهر المكاتب العالمية، إذ قامت الشركة البلجيكية “ DDS & Partners” بتصميم مخطط “تاج سيتي”، فيما قامت “Benoy” المعمارية المعترف بها دوليًا بتصميم مخطط “سراي”.\\n\\nوفي إطار مسئووليتها المجتمعية، إلتزمت شركة مدينة نصر للإسكان والتعمير بدورها التنموي للمناطق المحيطة بمشروعاتها في مدينة نصر، كما أن  مبادرات المسؤولية الاجتماعية تعد جزءا أساسيا من فلسفة الشركة.", "en": "Founded in 1959 as a public real estate company, Madinet Nasr for Housing & Development (MNHD) is a leading real estate development company in Egypt and has been publicly traded on the Egyptian stock exchange since 1995.\\n\\nInitially MNHD was established with the primary objective of developing 40ml sqm of land in Nasr City as well as other nearby areas on the outskirts of Cairo. Since then, with a capable team of over 450 professionals, MNHD has developed mega projects and infrastructures across Egypt, serving the needs of thousands of middle-income Egyptians.\\n\\nWith its restructuring, MNHD has expanded its target audience to capitalize on potential opportunities in the upper end class of the real estate market.  Building on inherent capabilities and strengths of MNHD, the company has launched two new mega mixed use residential projects. To that end it has contracted the services of world renowned architecture companies to develop the master plan to align with their vision of creating a destination with all its facets rather than just another housing development project. Conforming to international standards Taj City is envisioned to be Cairo’s cultural destination and Sarai to be Cairo’s entertainment destination. The master plan of Taj City was developed by DDS & Partners, a renowned Belgian firm while the master plan of Sarai was developed by internationally recognized architectural firm Benoy.\\n\\nAs part of MNHD’s commitment to the development of Egypt and its local communities, the company uses its core expertise to support the development of communities in Nasr City. CSR initiatives are a key part of the company’s corporate philosophy."}	{"card_icon": "https://storage.googleapis.com/sakneen-api-files/1600171946439-Madinet-Nasr-Dev-Logo.jpeg", "page_icon": "https://storage.googleapis.com/sakneen-api-files/1600171947010-Madinet-Nasr-Dev-Logo.jpeg"}	5f551f027974740067681f59
