62186a07-5e7d-474a-9709-8f32ff414627	2020-11-08 06:43:43.630141+00	2020-11-20 16:53:56.657215+00	{"ar": "بورتو جروب", "en": "Porto Group"}	\N	porto-group	بورتو-جروب	{"ar": "\\"نحن نؤمن بأن بيتك في مجتمعاتنا يجب أن يوفر أكثر من مجرد مسكن به حمام سباحه ولذلك نحن نقدم تجربه فريده للعطلات لعملائنا تتضمن خدمات و أنشطه عديده ومتميزة تدعمها خدمه للعملاء من الطراز الأول\\"\\n\\n- منصور عامر رئيس مجلس الإدارة والرئيس التنفيذي\\n\\nقام منصور عامر مؤسس بورتو جروب  بتأسيس  بورتو جروب عام 2005. وقد تمكنت بورتو طوال هذه السنوات من التوسع وبناء مكانة رائدة في القطاع العقاري لتصبح من كبرى الشركات الخاصة في السوق المصري. بدأت بورتو مشروعاتها بإقامة بورتو مارينا، وهو منتجع  متميز  في منطقة مارينا بالساحل الشمالي يضم أكثر من 990 وحدة. وبعد عشر سنوات، وصلت منتجعات بورتو إلى 15 منتجعاً رائعاً تضم أكثر من 30000 وحدة في أهم المقاصد السياحية في مصر والشرق الأوسط وأفريقيا. فمن الشواطئ الرملية البيضاء على البحر المتوسط إلى البحر الميت في الأردن، يمكن لجميع أفراد الأسرة الاستمتاع بتجربة غير مسبوقة في منتجعات بورتو التي تتواجد في الساحل الشمالي والبحر الأحمر وشرم الشيخ ومطروح. لقد أصبحت منتجعات بورتو من أهم المنتجعات السياحية في قطاع الضيافة على المستوى الإقليمي", "en": "Founded by Chairman and CEO Mansour Amer in 2005, Porto operates as one of the companies under Amer Group and has expanded into the largest privately held corporations in Egypt. Porto started with Porto Marina a resort in Marina on the North Coast over 990 unit. Ten years later, Porto Resorts now encompasses over 30,000 units at 15 beautiful resorts in premiere travel destinations throughout Egypt and Middle East North Africa. From the white, sandy beaches along the Mediterranean coast to the Dead Sea in Jordan, families can affordably experience the most sought after vacation destinations in the country through Porto Resorts. With resorts in the North Coast, Red Sea, Sharm El Sheikh, Matrouh, Agadir and Tartous Porto Resorts has established itself as a leader in the hospitality industry. As one of the largest resort developers in Egypt, Porto Resorts is constantly growing and improving by providing the best affordable luxury vacations available. With first-class accommodations and unparalleled customer service, Porto Resort's family-friendly resorts range from standard two bedroom apartments and cozy studios to spacious four-bedroom villas that all provide the essential comforts of home. More recently, Porto Resorts launched the Porto Cairo and Porto October communities in Cairo which features all the amenities of the resorts in addition to all services needed for first homeowners such as schools and hospitals. Porto Resorts is always growing and expanding to ensure the highest quality experience and value for Egyptian families"}	{"card_icon": "https://storage.googleapis.com/sakneen-api-files/1599744907038-porto logo.jpeg", "page_icon": "https://storage.googleapis.com/sakneen-api-files/1599744907769-porto logo.jpeg"}	5f5a2b8cb5710e0067094cdb
