a total of 32 hotels with 7,205 rooms and controls approximately 101 million sqm of land."}	{"card_icon": "https://storage.googleapis.com/sakneen-api-files/1603740357278-logo.jpeg", "page_icon": "https://storage.googleapis.com/sakneen-api-files/1603740358350-logo.jpeg"}	5f9722c7909a5b00188b9ed3
